import React from 'react';
import { useLocation } from 'react-router-dom';
import {
	BookedContainer,
	BookedDetails,
	BookedDetailsWrapper,
	BookedList,
	BookedListItem,
	BookedWrapper,
	GifWrapper,
} from './landing.styles';
import Titanic from '../../assets/Titanic.gif';

const LandingPage = () => {
	const location = useLocation();
	console.log(location.state.details);
	return (
		<div className="main">
			<BookedContainer>
				<BookedWrapper>
					<GifWrapper src={Titanic} alt="Nice gif!" style={{ margin: '10px' }} />
					<h2 style={{ textAlign: 'center' }}>Deine Buchung wurde bestätigt! ⚓</h2>
					<BookedDetails>Details:</BookedDetails>
					{location.state ? (
						<React.Fragment>
							<BookedDetailsWrapper>
								<BookedListItem>
									<BookedList className="border padding">Name</BookedList>
									<BookedList className="border padding">{location.state.details.name}</BookedList>
								</BookedListItem>
								<BookedListItem>
									<BookedList className="border padding">
										<span style={{ alignSel: 'flex-start' }}>Email</span>
										<span style={{ alignSel: 'flex-end' }}>{location.state.details.email}</span>
									</BookedList>
								</BookedListItem>
								<BookedListItem>
									<BookedList className="border padding">Personen</BookedList>
									<BookedList className="border padding">
										{location.state.details.person}
									</BookedList>
								</BookedListItem>
								<BookedListItem>
									<BookedList className="border padding">Von</BookedList>
									<BookedList className="border padding">
										{location.state.details.arrivalDate.getDate()}.
										{[11, 10, 9].includes(location.state.details.arrivalDate.getMonth())
											? location.state.details.arrivalDate.getMonth() + 1
											: '0' + (location.state.details.arrivalDate.getMonth() + 1)}
										.{location.state.details.arrivalDate.getFullYear()}
									</BookedList>
								</BookedListItem>
								<BookedListItem>
									<BookedList className="border padding">Bis</BookedList>
									<BookedList className="border padding">
										{location.state.details.departureDate.getDate()}.
										{[11, 10, 9].includes(location.state.details.departureDate.getMonth())
											? location.state.details.departureDate.getMonth() + 1
											: '0' + (location.state.details.departureDate.getMonth() + 1)}
										.{location.state.details.departureDate.getFullYear()}
									</BookedList>
								</BookedListItem>
							</BookedDetailsWrapper>
						</React.Fragment>
					) : null}
				</BookedWrapper>
			</BookedContainer>
		</div>
	);
};

export default LandingPage;
